INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('34b37467-9705-4ec1-8228-48df1fbe347e','Bulbasaur',001,15.2,28,45,49,49,65,65,45,'A strange seed was planted on its back at birth. The plant sprouts and grows with this Pokémon.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('fc36b5d5-77cf-475f-b530-fa01f18099a6','Ivysaur',002,28.7,36,60,62,63,80,80,60,'When the bulb on its back grows large, it appears to lose the ability to stand on its hind legs.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('9c317729-c62a-4ea0-b7ab-3b5b1da9edd3','Venusaur',003,220.5,79,80,82,83,100,100,80,'The plant blooms when it is asorbing solar energy. It stays on the move to seek sunlight.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('e39d5b26-167a-4d77-b0b9-680e4944e683','Charmander',004,18.7,24,39,52,43,60,50,65,'Obviously prefers hot places. When it rains, steam is said to spout from the tip of its tail.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('51e75512-3a92-46c3-985f-08133b4631ee','Charmeleon',005,41.9,43,58,64,58,80,65,80,'When it swings its burning tail, it elevates the temperature to unbearably high levels.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('07ba11e4-4eba-4414-8efc-846685c404ea','Charizard',006,199.5,67,78,84,78,109,85,100,'It spits fire that is hot enough to melt boulders. Known to cause forest fires unintentionally.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('361cf0c7-9153-4006-8be3-7ae408cacd12','Squirtle',007,19.8,20,44,48,65,50,64,43,'After birth, its back swells and hardens into a shell. Powerfully sprays foam from its mouth.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('d5d441dd-7fad-48c0-a217-0d6bac9aef78','Wartortle',008,49.6,39,59,63,80,65,80,58,'Often hides in water to stalk unwary prey. For swimming fast, it moves its ears to maintain balance.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('76aed66a-1b24-4c4e-94ba-45184d217b1f','Blastoise',009,188.5,63,79,83,100,85,105,78,'A brutal Pokémon with pressurized water jets on its shell. They are used for high speed tackles.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('9c66262a-562e-4654-b4e0-f5931f1bf7be','Caterpie',010,6.4,12,45,30,35,20,20,45,'Its short feet are tipped with suction pads that enable it to tirelessly climb slopes and walls.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('cef6c86d-ee64-41c2-abfb-3c5d27d69123','Metapod',011,21.8,28,50,20,55,25,25,30,'This Pokémon is vulnerable to attack while its shell is soft, exposing its weak and tender body.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('50327553-bcdb-414d-826a-3c004e581428','Butterfree',012,70.5,43,60,45,50,80,80,70,'In battle, it flaps its wings at high speed, releasing highly toxic dust into the air.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('7d881986-cfd3-4f68-8136-eb71a3b88f16','Weedle',013,7.1,12,40,35,30,20,20,50,'Often found in forests, eating leaves. It has a sharp, venomous stinger on its head.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('8b00205d-c728-4df4-9947-112faad08dad','Kakuna',014,22.0,24,45,25,50,25,25,35,'Almost incapable of moving, this Pokémon can only harden its shell to protect itself from predators.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('0e90d0e7-99cc-481e-adc3-1d86a2e885dc','Beedrill',015,65.0,39,65,80,40,45,80,75,'Flies at high speed and attacks using its large venomous stingers on its forelegs and tail.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('9b2b3522-e6e6-496c-862d-292f9b940ccc','Pidgey',016,4.0,12,40,45,40,35,35,56,'A common sight in forests and woods. It flaps its wings at ground level to kick up blinding sand.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('7a7f5aed-a7dd-48e9-953b-88fbef292a2d','Pidgeotto',017,66.1,43,63,60,55,50,50,71,'Very protective of its sprawling territory, this Pokémon will fiercely peck at any intruder.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('b8464eeb-de2f-40ee-96a0-708d01e094d8','Pidgeot',018,87.1,59,83,80,75,70,70,91,'When hunting, it skims the surface of water at high speed to pick off unwary prey such as Magikarp.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('e3fbfa36-3be8-42f4-9464-fdc207502c96','Rattata',019,7.7,12,30,56,35,25,35,72,'Bites anything when it attacks. Small and very quick, it is a common sight in many places.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('b03d5502-7551-4e15-954b-a5fe641a47c0','Raticate',020,40.8,28,55,81,60,50,70,97,'It uses its whiskers to maintain its balance and will slow down if they are cut off.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('ab2ee2f3-1569-442f-a3a0-471b4b01e6c5','Spearow',021,4.4,12,40,60,30,31,31,70,'Eats bugs in grassy areas. It has to flap its short wings at high speed to stay airborne.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('dccccd36-aa22-4e4c-8997-0b6548c4b88f','Fearow',022,83.8,47,65,90,65,61,61,100,'With its huge and magnificent wings, it can keep aloft without ever having to land for rest.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('13c5b8fd-eb3d-486d-ba51-e07d737fc34f','Ekans',023,15.2,79,35,60,44,40,54,55,'Moves silently and stealthily. Eats the eggs of birds, such as Pidgey and Spearow, whole.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('17e9efad-aedc-4c68-9062-d8350d87af0a','Arbok',024,143.3,138,60,85,69,65,79,80,'It is rumored that the ferocious warning markings on its belly differ from area to area.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('b3319dad-3525-40a2-b43a-671907a5028c','Pikachu',025,13.2,16,35,55,30,50,40,90,'When several of these Pokémon gather, their electricity could build and cause lightning storms.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('e2c48f7c-2e3f-4a13-a2a4-36dec5de66a0','Raichu',026,66.1,31,60,90,55,90,80,100,'Its long tail serves as a ground to protect itself from its own high voltage power.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('a214c6b8-3372-4ea6-924b-9e61ad23709c','Sandshrew',027,26.5,24,50,75,85,20,30,40,'Burrows deep underground in arid locations far from water. It only emerges to hunt for food.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('2465f966-4bf6-4925-9ac0-9331a1ee6a6a','Sandslash',028,65.0,39,75,100,110,45,55,65,'Curls up into a spiny ball when threatened. It can roll while curled up to attack or escape.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('fdd4a372-2a5a-4ef5-a420-d64b5d5c4f0e','Nidoran♀',029,15.4,16,55,47,52,40,40,41,'Although small, its venomous barbs render this Pokémon dangerous. The female has smaller horns.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('1580a10a-10a0-40df-85e2-181c8845e6e1','Nidorina',030,44.1,31,70,62,67,55,55,56,'The female''s horn develops slowly. Prefers physical attacks such as clawing and biting.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('4209256b-6453-4f4d-884b-a8fb737741a6','Nidoqueen',031,132.3,51,90,82,87,75,85,76,'Its hard scales provide strong protection. It uses its hefty bulk to execute powerful moves.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('06c02d09-e1b4-465b-b0ef-a05ccf148d78','Nidoran♂',032,19.8,20,46,57,40,40,40,50,'Stiffens its ears to sense danger. The larger its horns, the more powerful its secreted venom.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('2fce1485-4aee-4a3d-8d8e-dd76d32ffc34','Nidorino',033,43.0,35,61,72,57,55,55,65,'An aggressive Pokémon that is quick to attack. The horn on its head secretes a powerful venom.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('54c2baae-8697-4108-80af-8d63eb5c5bf1','Nidoking',034,136.7,55,81,92,77,85,75,85,'It uses its powerful tail in battle to smash, constrict, then break the prey''s bones.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('f5d056a1-359a-427e-a89b-6325811ae6b7','Clefairy',035,16.5,24,70,45,48,60,65,35,'Its magical and cute appeal has many admirers. It is rare and found only in certain areas.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('eb66b856-7378-4035-89eb-b14d3097f21a','Clefable',036,88.2,51,95,70,73,85,90,60,'A timid fairy Pokémon that is rarely seen. It will run and hide the moment it senses people.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('ffaf2165-71bd-401a-93e5-cbce52ff2683','Vulpix',037,21.8,24,38,41,40,50,65,65,'At the time of birth, it has just one tail. The tail splits from its tip as it grows older.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('2251da43-1aca-4b6e-9748-f03fb860c5f9','Ninetales',038,43.9,43,73,76,75,81,100,100,'Very smart and very vengeful. Grabbing one of its many tails could result in a 1000-year curse.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('b04023b6-febd-4c57-abe4-5145da4bf242','Jigglypuff',039,12.1,20,115,45,20,45,25,20,'When its huge eyes light up, it sings a mysteriously soothing melody that lulls its enemies to sleep.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('ea1550ae-5c7d-4751-a0fa-32878090b499','Wigglytuff',040,26.5,39,140,70,45,75,50,45,'The body is soft and rubbery. When angered, it will suck in air and inflate itself to an enormous size.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('14c6578b-f8e3-4f62-a27a-cb00d77ae507','Zubat',041,16.5,31,40,45,35,30,40,55,'Forms colonies in perpetually dark places. Uses ultrasonic waves to identify and approach targets.');
INSERT INTO Pokemon(GUID,Name,NationalID,Weight,Height,HP,Attack,Defense,SpecialAtk,SpecialDef,Speed,Description) VALUES('ee27c1e1-9896-4f24-a9f5-174e77b1e323','Golbat',042,121.3,63,75,80,70,65,75,90,'Once it strikes, it will not stop draining energy from the victim even if it gets too heavy to fly.');
